　【エントリーランナー向けニュートラルシューズ】<br>
アッパーにはストレッチエアーメッシュを採用し、通気性を保ちながら快適なフィッティングを提供、アウトソールにはストレッチウェブアウトソールを採用し、ブーストフォームのパフォーマンスを無駄なく引き出し、従来より更に快適なランニング楽しめる、エントリーランナーに最適なランニングシューズです。完走を目指すランナー、ジョギングにおすすめのシューズです。ウィズ（足幅）3E相当。<br>
<br>
■カラー：BK (コアブラック/ランニングホワイト/ユーティリティブラック F16)<br>
■サイズ：24.5～29.0cm (0.5cm刻み) <br>
■素材：アッパー/合成繊維、合成皮革、アウトソール/ゴム底<br><br><br>【himaraya】<style TYPE="text/css">

